// Servicios.jsx
export default function Servicios() {
  return (
    <div className="p-4">
      <h1 className="text-2xl font-bold text-center mb-4">Servicios</h1>
      <div className="flex flex-wrap gap-4">
        {/* Tarjeta para Vehículos */}
        <div className="flex-1 bg-white shadow-md rounded-lg p-4 text-center cursor-pointer hover:shadow-lg transition">
          <h2 className="text-xl font-semibold mb-2">Vehículos</h2>
          <p className="text-gray-600">
            Haz clic aquí para ver o registrar los servicios de los vehículos.
          </p>
        </div>

        {/* Tarjeta para Maquinaria */}
        <div className="flex-1 bg-white shadow-md rounded-lg p-4 text-center cursor-pointer hover:shadow-lg transition">
          <h2 className="text-xl font-semibold mb-2">Maquinaria</h2>
          <p className="text-gray-600">
            Haz clic aquí para ver o registrar los servicios de la maquinaria.
          </p>
        </div>
      </div>
    </div>
  );
}
